using System;
using GreenUtil.Imaging;
using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace GreenUtil.Test.Imaging
{
    [TestClass]
    public class FromBase64ImageTest
    {

        [TestMethod]
        public void WhenBase64StringIsNullThenFromBase64ToImageShouldThrowArgumentNullException()
        {
            Assert.ThrowsException<ArgumentNullException>(() => ImageUtil.FromBase64ToImage(null));
        }

        [TestMethod]
        public void WhenPNGBase64StringWithPrefixIsValidThenFromBase64ToImageShouldCreateImage()
        {
            string base64 = "data:image/png;base64,";

            using (var image = ImageUtil.FromBase64ToImage(base64))
            {
                Assert.IsNotNull(image);
                Assert.AreNotEqual(0, image.Height);
                Assert.AreNotEqual(0, image.Width);
            }
        }

        [TestMethod]
        public void WhenPNGBase64StringWithoutPrefixIsValidThenFromBase64ToImageShouldCreateImage()
        {
            string base64 = "";

            using (var image = ImageUtil.FromBase64ToImage(base64))
            {
                Assert.IsNotNull(image);
                Assert.AreNotEqual(0, image.Height);
                Assert.AreNotEqual(0, image.Width);
            }
        }

        [TestMethod]
        public void WhenPNGBase64StringWithoutPrefixIsInvalidThenFromBase64ToImageShouldThrowException()
        {
            string base64 = "";

            Assert.ThrowsException<ArgumentException>(() => ImageUtil.FromBase64ToImage(base64));
        }

        [TestMethod]
        public void WhenPNGBase64StringWithPrefixIsInvalidThenFromBase64ToImageShouldThrowException()
        {
            string base64 = "data:image/png;base64,";

            Assert.ThrowsException<ArgumentException>(() => ImageUtil.FromBase64ToImage(base64));
        }

        [TestMethod]
        public void WhenJPGBase64StringWithPrefixIsValidThenFromBase64ToImageShouldCreateImage()
        {
            string base64 = "data:image/jpeg;base64,";

            using (var image = ImageUtil.FromBase64ToImage(base64))
            {
                Assert.IsNotNull(image);
                Assert.AreNotEqual(0, image.Height);
                Assert.AreNotEqual(0, image.Width);
            }
        }

        [TestMethod]
        public void WhenJPGBase64StringWithoutPrefixIsValidThenFromBase64ToImageShouldCreateImage()
        {
            string base64 = "";

            using (var image = ImageUtil.FromBase64ToImage(base64))
            {
                Assert.IsNotNull(image);
                Assert.AreNotEqual(0, image.Height);
                Assert.AreNotEqual(0, image.Width);
            }
        }

        [TestMethod]
        public void WhenJPGBase64StringWithPrefixIsInvalidThenFromBase64ToImageShouldThrowArgumentException()
        {
            string base64 = "data:image/jpeg;base64,";

            Assert.ThrowsException<ArgumentException>(() => ImageUtil.FromBase64ToImage(base64));
        }

        [TestMethod]
        public void WhenJPGBase64StringWithoutPrefixIsinvalidThenFromBase64ToImageShouldThrowArgumentException()
        {
            string base64 = "";

            Assert.ThrowsException<ArgumentException>(() => ImageUtil.FromBase64ToImage(base64));
        }

        [TestMethod]
        public void WhenTIFBase64StringWithPrefixIsValidThenFromBase64ToImageShouldCreateImage()
        {
            string base64 = "data:image/tif;base64,";
            using (var image = ImageUtil.FromBase64ToImage(base64))
            {
                Assert.IsNotNull(image);
                Assert.AreNotEqual(0, image.Height);
                Assert.AreNotEqual(0, image.Width);
            }
        }

        [TestMethod]
        public void WhenTIFBase64StringWithoutPrefixIsValidThenFromBase64ToImageShouldCreateImage()
        {
            string base64 = "";

            using (var image = ImageUtil.FromBase64ToImage(base64))
            {
                Assert.IsNotNull(image);
                Assert.AreNotEqual(0, image.Height);
                Assert.AreNotEqual(0, image.Width);
            }
        }

        [TestMethod]
        public void WhenTIFBase64StringWithPrefixIsInvalidThenFromBase64ToImageShouldThrowArgumentException()
        {
            string base64 = "data:image/tif;base64,x9j/4AAQSkZJRgABAQEBLAEsAAD/2waa";

            Assert.ThrowsException<ArgumentException>(() => ImageUtil.FromBase64ToImage(base64));
        }
    }
}
